import styled from "styled-components";

function SectionProject() {
  return (
    <Container id="project">
      <Wrap>
        <Title>
          <h4>04</h4>
          <h2>learn react project</h2>
        </Title>
        <TitleBox>
          <h3>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Quaerat nesciunt, unde vel, ipsum nulla quos alias quidem velit vero est sed. Voluptate nihil distinctio maiores architecto
            corrupti, quam suscipit laudantium!
          </h3>
        </TitleBox>
        <ListWrap>
          <ul>
            <ListBox>
              <a href="https://kimahr.github.io/movie-list/">MOVIELIST</a>
            </ListBox>
            <ListBox>
              <a href="https://kimahr.github.io/todolist/">TODOLIST</a>
            </ListBox>
            <ListBox>
              <a href="https://kimahr.github.io/instagram/">INSTAGRAM</a>
            </ListBox>
          </ul>
        </ListWrap>
      </Wrap>
    </Container>
  );
}

export default SectionProject;

const Container = styled.div`
  width: 100%;
  height: 50vw;
  max-width: 1400px;
  margin: 0 auto;
  background-color: ${({ theme }) => theme.colors.white_color};
  @media ${({ theme }) => theme.device.laptop} {
    z-index: 2;
    position: relative;

    width: 100%;
    padding-top: 150px;
  }
`;

const Wrap = styled.div``;

const Title = styled.div`
  @media ${({ theme }) => theme.device.laptop} {
    z-index: 2;
    position: relative;
    width: 100%;
    max-width: 80%;
    margin: 0 auto;
  }
  h2 {
    font-weight: ${({ theme }) => theme.fonts.weightExtra};
    color: ${({ theme }) => theme.colors.black_color};
    margin-bottom: 60px;
    width: 100%;

    font-weight: 600;
    color: #000;
    font-size: 60px;
    margin-top: 20px;
    line-height: 120%;

    @media ${({ theme }) => theme.device.laptop} {
      width: 100%;

      font-weight: 600;
      color: #000;
      font-size: 50px;
      margin-top: 20px;
      line-height: 120%;
    }
  }
  h4 {
    font-family: "Montserrat";
    font-weight: 500;
    color: #000;
    font-size: 20px;
  }
`;

const TitleBox = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  margin: 3% auto;
  @media ${({ theme }) => theme.device.laptop} {
    z-index: 2;
    position: relative;
    width: 100%;
    max-width: 80%;
    margin: 0 auto;
    /* padding-top: 200px; */
  }

  h4 {
    @media ${({ theme }) => theme.device.laptop} {
      float: left;
      width: 50%;
    }
  }
  h3 {
    width: 70%;
    font-weight: ${({ theme }) => theme.fonts.weightSemiRegular};
    color: #000;
    font-size: ${({ theme }) => theme.fonts.fontRegular};

    margin-top: 60px;
    width: 70%;
    font-family: "Montserrat";
    font-weight: 500;
    color: #000;
    font-size: 18px;
    line-height: 160%;
    margin-top: 60px;
    @media ${({ theme }) => theme.device.laptop} {
      width: 100%;
    }
  }
`;

const ListWrap = styled.div`
  width: 100%;
  height: 50%;
  margin-top: 140px;
  @media ${({ theme }) => theme.device.laptop} {
    width: 100%;
  }

  ul {
    width: 100%;
    display: flex;
    text-align: center;
    @media ${({ theme }) => theme.device.laptop} {
      width: 100%;
    }
  }
`;

const ListBox = styled.li`
  width: 33.333%;
  height: 30vw;
  margin-left: 20px;
  border: 1px solid black;
  transition: all 0.3s;
  :first-child {
    margin-left: 0;
  }
  :hover {
    border-radius: 30%;
  }
`;
